import React, { Component } from "react";
import { Container, Row } from "react-bootstrap";

class Cards extends Component {
  render() {
    return (
      <div>
        <Container>
          <Row>
            <div className="col-6"></div>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Cards;
